import React from 'react';
import logo from "../images/logo.png"; 
import Product from './Product';

const Header = () => {
  return (
    <header>
      <nav className="navbar">
        <a href="/" className="logo">
          <img src={logo} alt="logo" />
        </a>

        <ul className="nav-links">
          <li className="nav-item"><a href="#">Home</a></li>
          <li className="nav-item"><a href="#">Product</a></li>
          <li className="nav-item"><a href="/checkout">Cart</a></li>
          <button className="shopping-cart-button" style={{ fontSize: "26px" }}>
  <i className="fa fa-shopping-cart"></i>
</button>


        </ul>
      </nav>

      <div class="sidebar">
    <button class="button" onclick="togglePopup()">Click Me</button>
    <div class="popup" id="popup">Popup Content</div>
  </div>
    </header>
  );
}

export default Header;
